import React from 'react';
import logo from './logo.svg';
import './App.css';
import AddSupply from './components/AddSupply.js';
import Landing from './components/Landing.js';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <Landing/>
          </Route>
          <Route path="/add-supply">
            <AddSupply/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
